import './App.css';
import Select from 'react-select'

const serviceList = [
  'Internet',
  'Telewizja',
  'Abonament telefoniczny',
  'Dekoder 4K'
];

const yearOptions = [
  '2023',
  '2024',
  '2025'
]

function App() {
  return (
    <div className="App">
      <div className="navbar">
        Kalkulator cen usług
      </div>

      <div className="service-selector">
        <ul>
          {serviceList.map((service, key) => {
            return (
              <li className={`serivce-selector__item`} key={key}>{service}</li>
            )
          })}
        </ul>
      </div>

      <div className="service-calculator">
        <p>Wybrane usługi:</p>
        <Select options={yearOptions}/>
        <p>Suma:</p>
      </div>

      <div className="footer">
        Bartosz Wiecheć
      </div>
    </div>
  );
}

export default App;
